import { useEffect, useState } from "react";
import axios from "axios";
import { Button, Input, Table } from "@/components/ui";

export default function CreateClassPage() {
    const [classes, setClasses] = useState([]);
    const [formData, setFormData] = useState({
        name: "", type: "", grade: "", max_student: "", fee_amount: "", current_student: 0
    });

    useEffect(() => {
        fetchClasses();
    }, []);

    const fetchClasses = async () => {
        try {
            const res = await axios.get("http://localhost:5000/classes");
            setClasses(res.data);
        } catch (error) {
            console.error("Lỗi khi tải danh sách lớp:", error);
        }
    };

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await axios.post("http://localhost:5000/classes", formData);
            fetchClasses();
            setFormData({ name: "", type: "", grade: "", max_student: "", fee_amount: "", current_student: 0 });
        } catch (error) {
            console.error("Lỗi khi thêm lớp:", error);
        }
    };

    return (
        <div className="p-6 max-w-3xl mx-auto">
            <h2 className="text-xl font-semibold mb-4">Tạo lớp học</h2>
            <form className="space-y-4" onSubmit={handleSubmit}>
                <Input name="name" placeholder="Tên lớp" value={formData.name} onChange={handleChange} required />
                <Input name="type" placeholder="Loại lớp" value={formData.type} onChange={handleChange} required />
                <Input name="grade" placeholder="Cấp độ" value={formData.grade} onChange={handleChange} required />
                <Input name="max_student" type="number" placeholder="Số lượng tối đa" value={formData.max_student} onChange={handleChange} required />
                <Input name="fee_amount" type="number" placeholder="Học phí" value={formData.fee_amount} onChange={handleChange} required />
                <Button type="submit">Thêm lớp</Button>
            </form>

            <h2 className="text-xl font-semibold mt-6">Danh sách lớp</h2>
            <Table className="mt-4">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Tên lớp</th>
                        <th>Loại lớp</th>
                        <th>Cấp độ</th>
                        <th>Số lượng tối đa</th>
                        <th>Học phí</th>
                    </tr>
                </thead>
                <tbody>
                    {classes.map(cls => (
                        <tr key={cls.id}>
                            <td>{cls.id}</td>
                            <td>{cls.name}</td>
                            <td>{cls.type}</td>
                            <td>{cls.grade}</td>
                            <td>{cls.max_student}</td>
                            <td>{cls.fee_amount}</td>
                        </tr>
                    ))}
                </tbody>
            </Table>
        </div>
    );
}
